// GPIO controller

#include "ILI9488.h"
#include <cassert>
#include <cmath>

using namespace std;


ILI9488::ILI9488(GPIOPIN **DCPIN,GPIOPIN **RSTPIN)
{
	// SPI init
	retv = spi_bus.spi_init(LCD_SPI_DEVICE,0,8,48000000);
	//assert (retv>=0);
	//retv = spi_bus32.spi_init(LCD_SPI_DEVICE,0,16,48000000);
	//assert (retv>=0);
	// Exit program is there is an exception/error with spidev init
	//std::cout << "assert_retv: " << retv << std::endl;

	// Initialize GPIO pointers of pointers
	this->DCPIN = DCPIN;
	this->RSTPIN = RSTPIN;
	 	
}

void ILI9488::lcd_sendCmd(uint8_t data)
{
	char buf;
	(*DCPIN)->set_pin(PINLOW); // Select Command (from D/C pin)
	buf = (char)data;
	retv = spi_bus.spi_write(&buf, 1);	// Send command
}

void ILI9488::lcd_sendData(uint8_t data)
{
	char buf;
	(*DCPIN)->set_pin(PINHIGH); // Select Data (from D/C pin)
	buf = (char)data;
	retv = spi_bus.spi_write(&buf, 1);	// Send command
}

void ILI9488::lcd_sendData16(unsigned int data)
{
	uint8_t data1 = data>>8;
	uint8_t data2 = data&0xff;

	char buf[2];
	(*DCPIN)->set_pin(PINHIGH); // Select Data (from D/C pin)
	buf[0] = (char)data1;
	buf[1] = (char)data2;
	retv = spi_bus.spi_write(buf, 2);	// Send data
}

// Array holding 16 bytes elemetns
void ILI9488::lcd_sendMultipleBytes(std::vector<uint32_t> data)
{
	int buffer32 = data.size();
	int bytes = buffer32*4;
	
	// Initialize array
	uint32_t* u32buf = &data[0];

	(*DCPIN)->set_pin(PINHIGH); // Select Data (from D/C pin)
	retv = spi_bus.spi_write(u32buf, bytes);	// Send data

	//delete[] u32buf;
}

void ILI9488::lcd_init()
{
	// Make D/C and RST lines output pins
	(*DCPIN)->pin_io(PINOUT);
	(*RSTPIN)->pin_io(PINOUT);

	(*DCPIN)->set_pin(PINHIGH); // Select Data (from D/C pin)
	
	// Reset
	(*RSTPIN)->set_pin(PINHIGH); // RST ON
	usleep(10000);
	(*RSTPIN)->set_pin(PINLOW); // RST OFF
	usleep(10000);
	(*RSTPIN)->set_pin(PINHIGH); // RST ON
	//usleep(10000);

	lcd_sendCmd(0xE0);
	lcd_sendData(0x00);
	lcd_sendData(0x03);
	lcd_sendData(0x09);
	lcd_sendData(0x08);
	lcd_sendData(0x16);
	lcd_sendData(0x0A);
	lcd_sendData(0x3F);
	lcd_sendData(0x78);
	lcd_sendData(0x4C);
	lcd_sendData(0x09);
	lcd_sendData(0x0A);
	lcd_sendData(0x08);
	lcd_sendData(0x16);
	lcd_sendData(0x1A);
	lcd_sendData(0x0F);


	lcd_sendCmd(0XE1);
	lcd_sendData(0x00);
	lcd_sendData(0x16);
	lcd_sendData(0x19);
	lcd_sendData(0x03);
	lcd_sendData(0x0F);
	lcd_sendData(0x05);
	lcd_sendData(0x32);
	lcd_sendData(0x45);
	lcd_sendData(0x46);
	lcd_sendData(0x04);
	lcd_sendData(0x0E);
	lcd_sendData(0x0D);
	lcd_sendData(0x35);
	lcd_sendData(0x37);
	lcd_sendData(0x0F);

	lcd_sendCmd(0XC0);     // Power Control 1
	lcd_sendData(0x17);    // Vreg1out
	lcd_sendData(0x15);    // Verg2out

	lcd_sendCmd(0xC1);     // Power Control 2
	lcd_sendData(0x41);    // VGH,VGL

	lcd_sendCmd(0xC5);     // Power Control 3
	lcd_sendData(0x00);
	lcd_sendData(0x12);    // Vcom
	lcd_sendData(0x80);

	// Portrait
	lcd_sendCmd(0x36);     // Memory Access
	lcd_sendData(0x48);

	lcd_sendCmd(0x3A);     // Interface Pixel Format
	lcd_sendData(0x66);    // 18 bit

	lcd_sendCmd(0XB0);     // Interface Mode Control
	lcd_sendData(0x80);    // SDO NOT USE

	lcd_sendCmd(0xB1);     // Frame rate
	lcd_sendData(0xA0);    // 60Hz

	lcd_sendCmd(0xB4);     // Display Inversion Control
	lcd_sendData(0x02);    // 2-dot

	lcd_sendCmd(0XB6);     // Display Function Control  RGB/MCU Interface Control

	lcd_sendData(0x02);    // MCU
	lcd_sendData(0x02);    // Source,Gate scan dieection

	lcd_sendCmd(0XE9);     // Set Image Functio
	lcd_sendData(0x00);    // Disable 24 bit data

	lcd_sendCmd(0xF7);     // Adjust Control
	lcd_sendData(0xA9);
	lcd_sendData(0x51);
	lcd_sendData(0x2C);
	lcd_sendData(0x82);    // D7 stream, loose


	lcd_sendCmd(ILI9488_SLPOUT);    //Exit Sleep
	usleep(120000);
	lcd_sendCmd(ILI9488_DISPON);    //Display on

}


void ILI9488::lcd_setX(unsigned int x0,unsigned int x1)
{
	lcd_sendCmd(ILI9488_CASET);
	lcd_sendData16(x0);
	lcd_sendData16(x1);
}

void ILI9488::lcd_setY(unsigned int y0,unsigned int y1)
{
	lcd_sendCmd(ILI9488_PASET);
	lcd_sendData16(y0);
	lcd_sendData16(y1);
}

// Fill a portion of the screen
void ILI9488::lcd_bmp(std::vector<uint32_t> BMP,unsigned int x0,unsigned int y0,unsigned int xn,unsigned int yn)
{
	lcd_setX(x0,xn);
	lcd_setY(y0,yn);
	lcd_sendCmd(ILI9488_CMD_MEMORY_WRITE);
	lcd_sendCmd(ILI9488_CMD_WRITE_MEMORY_CONTINUE);
	lcd_sendMultipleBytes(BMP);
}

void ILI9488::lcd_setOrientation(int direction)
{
	uint8_t cmd = 0x36;
	uint8_t data;

	switch( direction )
	{
		case 0: // Portrait
			data = 0x48;
		break;

		case 1: // Landscape
			data = 0xE8;
		break;
	}

	// Set orientation
	lcd_sendCmd(0x36);    
	lcd_sendData(data);
}


